let hexToRgba = hex => {
  let r = parseInt(hex.substring(0, 2), 16);
  let g = parseInt(hex.substring(2, 4), 16);
  let b = parseInt(hex.substring(4, 6), 16);
  return [r, g, b, 0.5].join(',');
};

let circle = $('.circle');
let title = $('.title');
let style = $('#style');
let body = $('html, body');
let paletteElems = $('.color-overview > li');
let borderSize = '40px';
circle.click(e => {
  e.preventDefault();
  let palette = palettes[Math.floor(Math.random() * palettes.length)];
  title.text(palette.name.trim());

  body.css({
    background: '#' + palette.colors[4],
    color: '#' + palette.colors[Math.floor(Math.random() * 3)] });


  palette.colors.forEach((c, i) => {
    paletteElems.eq(i).
    css('background', '#' + c).
    attr('data-bg-color', '#' + c.toUpperCase());
  });

  style.html(`
        .circle:before, .circle:after {
            box-shadow:
                    ${borderSize} 0 0 rgba(${hexToRgba(palette.colors[0])}) inset,
                    0 ${borderSize} 0 rgba(${hexToRgba(palette.colors[1])}) inset,
                    -${borderSize} 0 0 rgba(${hexToRgba(palette.colors[2])}) inset,
                    0 -${borderSize} 0 rgba(${hexToRgba(palette.colors[3])}) inset;
        }
    `);
});